window.bookSummaryJSON = "<p>The essential skill of creating and maintaining new businesses - the art of the entrepreneur - can be summed up in a single word: managing. In <i>High Output Management</i>, Andrew S. Grove, former chairman and CEO (and employee number three) of Intel, shares his perspective on how to build and run a company. Born of Grove’s experiences at one of America’s leading technology companies, this legendary management book is a Silicon Valley staple, equally appropriate for sales managers, accountants, consultants, and teachers, as well as CEOs and start-up founders. Grove covers techniques for creating highly productive teams, demonstrating methods of motivation that lead to peak performance - throughout, <i>High Output Management</i> is a practical handbook for navigating real-life business scenarios and a powerful management manifesto with the ability to revolutionize the way we work. </p> <p><b>* This audiobook edition includes a downloadable PDF of selected content from the book.</b></p> <p><b>PLEASE NOTE: When you purchase this title, the accompanying PDF will be available in your Audible Library along with the audio.</b></p>"; 
